import React, { Fragment } from 'react';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import { logout } from '../../actions/auth';
import { Nav, Navbar } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';

import { isAdmin, isTeacher, isStudent } from '../../utils/helpers';

const AppNavbar = ({ auth: { isAuthenticated, loading }, logout }) => {
  console.log('Admin je: ' + isAdmin());
  console.log('teacher je: ' + isTeacher());
  console.log('Student je: ' + isStudent());
  const authLink = (
    <Nav className='display: flex;'>
      <Nav.Link
        activeStyle={{ color: '#ED5035' }}
        as={NavLink}
        exact
        to='/subjects'
      >
        Subjects
      </Nav.Link>
      {isTeacher() && (
        <Nav.Link
          activeStyle={{ color: '#ED5035' }}
          as={NavLink}
          exact
          to='/mysubjects'
        >
          My Subjects
        </Nav.Link>
      )}
      {isAdmin() && (
        <Nav>
          <Nav.Link
            activeStyle={{ color: '#ED5035' }}
            as={NavLink}
            exact
            to='/subject/add'
          >
            Add New Subject
          </Nav.Link>

          <Nav.Link
            activeStyle={{ color: '#ED5035' }}
            as={NavLink}
            exact
            to='/appointments'
          >
            Appointments
          </Nav.Link>
        </Nav>
      )}

      <Nav.Link
        activeStyle={{ color: '#ED5035' }}
        as={NavLink}
        exact
        to='/appointment/add'
      >
        Add New Appointment
      </Nav.Link>
      <Nav.Item>
        <Nav.Link to='/dashboard'>
          <i className='fas fa-user'></i>{' '}
          <span className='hide-sm'>Dashboard</span>
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link onClick={logout} href='#!'>
          <i className='fas fa-sign-out-alt'></i>{' '}
          <span className='hide-sm'>Logout</span>
        </Nav.Link>
      </Nav.Item>
    </Nav>
  );

  const guestLinks = (
    <Nav className='ml-auto'>
      <Nav.Item>
        <Nav.Link to='/register' exact as={NavLink}>
          Register
        </Nav.Link>
      </Nav.Item>
      <Nav.Item>
        <Nav.Link to='/login' exact as={NavLink}>
          Login
        </Nav.Link>
      </Nav.Item>
    </Nav>
  );
  //TODO napraviti vise ovih

  return (
    <div className='navigation-bar'>
      <Navbar expand='lg'>
        <Nav>
          <Navbar.Brand to='/' exact as={NavLink}>
            Tutor.ba
          </Navbar.Brand>
        </Nav>
        <Navbar.Toggle aria-controls='basic-navbar-nav' />
        <Navbar.Collapse id='basic-navbar-nav'>
          {!loading && (
            <Fragment>{isAuthenticated ? authLink : guestLinks}</Fragment>
          )}
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

AppNavbar.propTypes = {
  logout: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
};

const mapStateToProps = (state) => ({
  auth: state.auth,
});

export default connect(mapStateToProps, { logout })(AppNavbar);
